9b7c2360-7324-4968-8176-96841e569e0c.text:
A, B, C, X = [int(input()) for _ in range(4)]

ans = 0
for a in range(A + 1):  # 1からAまで　0は考慮しない
    for b in range(B + 1):
        for c in range(C + 1):
            if a * 500 + b * 100 + c * 50 == X:
                ans += 1
print(ans)
